import React from 'react'
import About from './about'
import Contact from './contacts';
import Projects from './projects';
import Skills from './skills';
import Work from './work';
import "./body.css";

function Body() {
    return (
      <div className="body">
        <section id="about">
          <About />
        </section>
        <section id="projects">
          <Projects />
        </section>
        <section id="skills">
          <Skills />
        </section>
        <section id="contact">
          <Work />
        </section>
        <section id="contact">
          <Contact />
        </section>
      </div>
    );
}

export default Body
